export const AddCategory = () => {
  const [inputValue] = useState('Hola mundo');

  const handleInputChange = (e) => {
    e.setInputValue();
  };

  const handleSumit = (e) => {
    e.preventDefault();
  };

  return (
    <form onSubmit={handleSumit}>
      <input type='text' value={inputValue} onChange={handleInputChange} />
    </form>
  );
};
